function dialogAlert(n,o){$(".lnv-dialog-alert").length||lnv.alert({content:n,alertBtnText:o})}function dialogConfirm(n,o,t,e){$(".lnv-dialog-confirm").length||lnv.confirm({content:n,confirmBtnText:o,cancelBtnText:t,confirmHandler:function(){window.location.href=e}})}function dialogRemove(n,o,t){$(".lnv-dialog-confirm").length||lnv.confirm({content:n,confirmBtnText:o,cancelBtnText:t,confirmHandler:function(){doRemove()}})}